import { PixiWorld } from '../pixi_world';
import * as PIXI from 'pixi.js';
import { Application } from '../../../app';
import { IRenderable } from '../../core/components/rendering/renderers/Interfaces/irenderable1';
import { IHitable } from '../../core/components/rendering/renderers/Interfaces/ihitable';
import { CursorType } from '../../core/components/input/interaction/cursor_type';
import { SpriteItem } from '../../core/components/rendering/renderers/items/sprite_item';
import { GameObject } from '../../core/components/core/game_object';
import Camera from '../../core/components/rendering/camera';

export default class PixiSpriteRenderer implements IRenderable, IHitable {
  cursorType: CursorType = CursorType.DEFAULT;
  world!: PixiWorld;
  items!: SpriteItem;
  gameObject!: GameObject;
  private _sprite: PIXI.Sprite;

  constructor() {
    this.world = Application.instance.renderer.world as PixiWorld;
    this._sprite = new PIXI.Sprite()
  }

  public SetItem(spriteItem: SpriteItem): PixiSpriteRenderer{
    this.items = spriteItem;
    return this;
  }

  Setup(): void {
    var texture = PIXI.Texture.from(this.items.texture);
    this._sprite = new PIXI.Sprite(texture);
    this.items.width = this.items.width != null ? this.items.width :this._sprite.width;
    this.items.height = this.items.height != null ? this.items.height : this._sprite.height;

    this.Draw();
    this.world._app.stage.addChild(this._sprite);
  }
  Draw(): void {
    let transform = this.gameObject.transform;
    let position = transform.position;
    
    if(this.items.static){
      position = Camera.mainCamera.ViewToScreenSpace(position.subtract(Camera.mainCamera.gameObject.transform.position));
    }
    else{
      position = Camera.mainCamera.ViewToScreenSpace(position);
    }

    this._sprite.texture = PIXI.Texture.from(this.items.texture);

    this._sprite.position = new PIXI.Point(position.x, position.y);
    this._sprite.angle = -transform.rotation;

    let scale = transform.scale.multiplyXY(Camera.mainCamera.zoom, Camera.mainCamera.zoom);
    this._sprite.scale = new PIXI.Point(scale.x, scale.y);
    this._sprite.anchor = new PIXI.Point(this.items.pivot.x, this.items.pivot.y);
    this._sprite.width = this._sprite.width * scale.x * this.items.imageSize;
    this._sprite.height = this._sprite.height * scale.y * this.items.imageSize;
    this._sprite.alpha = this.items.alpha;
    this._sprite.tint =  this.items.tint.HexCode;
    this._sprite.zIndex = this.items.zIndex;

    if(this.items.width != null){
      this._sprite.width = this.items.width * scale.x * this.items.imageSize;
    }
    if(this.items.height != null){
      this._sprite.height = this.items.height * scale.y * this.items.imageSize;
    }

    if(this.cursorType != CursorType.DEFAULT){
      this._sprite.interactive = true;
      this._sprite.cursor = CursorType[this.cursorType];
    }
  }

  CheckHit(positionX: number, positionY: number): boolean {
      let point:PIXI.Point = new PIXI.Point(positionX, positionY);  
      return this._sprite.containsPoint(point);
  }

  SetCursor(cursor: CursorType): void {
    this.cursorType = cursor;
  }

  Destroy(): void {
    this._sprite.destroy();
  }
}
